import React, { useState } from 'react';
import Menu from './Menu';
import ProfilePage from './profile';
import ClassesPage from './classes';
import BookingPage from './bookings';
import HomePage from './home';
import LoginPage from './login'
import $ from 'jquery';


function App() {

  const [currentPage, setCurrentPage] = useState('index');

  const handleMenuClick = (butName) => {
    setCurrentPage(butName);
  };

  let content;

  switch(currentPage) {
    case 'home':
      content = <HomePage />;
      break;
    case 'profile':
      content = <ProfilePage />;
      break;
    case 'bookings':
      content = <BookingPage />;
      break;
    case 'classes':
      content = <ClassesPage />;
      break;
    case 'createaccount':
      content = <LoginPage />;
      break;
    case 'login':
      content = <LoginPage />;
      break;
    default:
      content = <HomePage />;
  }

  return (
    <div>
      <Menu handleMenuClick={handleMenuClick} />
      <div>{content}</div>
    </div>
  );
}

export default App;
